window.bookSummaryJSON = "<p><b>Laughter Academy is in trouble.</b></p> <p>The student witches are growing increasingly reckless, preying on the mundanes below the mountains as their tutors plot and scheme to take advantage of the chaos. And no one seems to know why.</p> <p>Emily is in no condition to intervene. But she cannot refuse. Heading to Laughter, Emily finds herself dragged into a world of schoolgirl games, staffroom politics, and a deadly plot aimed at the heart of the Allied Lands themselves....</p>"; 
